class Show extends Component{


    render(){

        return(
            <Grid container
                justify='space-evenly'
            >
                <Grid
                    item xs={12} sm={6} md={4}
                >
           <h1>{this.props.data[0].id} hola</h1>
       </Grid>
       <Grid item xs={12} sm={6}>
           <h1>{this.props.data[0].text} hola</h1>
        </Grid>

    </Grid>
        )
    }
}

export default Show
